import React from 'react';

const User = (props) => {
    const {name, age, phone, address, email, company, picture, gender, balance, id} ={props,user};
    return (
        <div>
            <h1>ID: {id}</h1>
            <h2>Name: {name}</h2>
            <img></img>
        </div>
    );
};

export default User;
